import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';

const Success = () => {
  return (
    <div className="row">
      <div className="col s6 m6 l6 offset-s3 offset-m3 offset-l3">
        <div className="success-container">
          <div className="success-container_header">
            <h1>Your payment was successfull</h1>
          </div>
          <div className="success-container_body">
            <div>
              <Link to="/orders" className="success-container_body">
                View your orders
              </Link>
            </div>
            <div>
              {' '}
              <Link to="/" className="success-container_link">
                Home
              </Link>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Success;
